# ## Level 3 - Pandas + Text Analyse
# 
# Das Datensets enthält viele IMDB Bewertungen die in positiv und negativ klassifiziert sind. Das Datenset kann hier runtergladen werden: https://drive.google.com/file/d/126iN3cAbopziPyqADSXyqiyVupgeUE6X/view?usp=sharing
# 
# - Wie viele positive und negative Bewertungen enthält das Datenset?
# - Manche der Reviews enthalten noch HTML Tags (z.B. in row 3). Schaue dir die Bewertung an und entferne dann alle HTML Tags im Datenset
# - In einigen Reviews sind URLs enthalten. Filter alle reviews die eine URL (https://...) enthalten.
# 
# Text Preprocessing
# - Wandle alle Reviews in lowercase um (keine Großbuchstaben mehr)
# - Entferne alle Interpunktionen (z.B. !,;."?) (Tipp: Das string package könnte helfen)
