# In[1]:


import pandas as pd


# In[2]:


df_reviews = pd.read_csv('IMDB Dataset.csv')


# In[3]:


df_reviews.head(5)


# In[4]:


#Wie viele positive und negative Bewertungen enthält das Datenset?
df_reviews['sentiment'].value_counts()


# In[5]:


#Manche der Reviews enthalten noch HTML Tags (z.B. in row 3).
#Schaue dir die Bewertung an und entferne dann alle HTML Tags im Datenset
df_reviews.loc[2]['review']


# In[7]:


import re


# In[8]:


tag_re = re.compile(r'<[^>]+>')

def remove_html_tags(text):
    return tag_re.sub('', text)

remove_html_tags(df_reviews.loc[2]['review'])


# In[80]:


for index in df_reviews.index:
    if index < 10: # alle zeilen dauern sehr lang, deshalb nur die ersten 10
        df_reviews.loc[index,'review_clean'] =  remove_html_tags(df_reviews.loc[index,'review'])
        
df_reviews.head(4)


# In[9]:


df_reviews['review'].apply(lambda x: remove_html_tags(x))


# In[81]:


#In einigen Reviews sind URLs enthalten. Filter alle reviews die eine URL (https://...) enthalten.
df_reviews['review_contains_url'] = df_reviews['review'].str.contains('http')
df_reviews['review_contains_url'].value_counts()


# In[82]:


df_reviews.head(3)


# In[83]:


df_reviews.loc[df_reviews['review_contains_url']==True] #Nan bei index > 9


# In[84]:


#Wandle alle Reviews in lowercase um (keine Großbuchstaben mehr)
df_reviews['review_clean'] = df_reviews['review_clean'].str.lower()

df_reviews.head(5)


# In[85]:



#Entferne alle Interpunktionen (z.B. !,;."?) (Tipp: Das string package könnte helfen)
import string

for index in df_reviews.index:
    if index < 10: # alle zeilen dauern sehr lang, deshalb nur die ersten 10
        df_reviews.loc[index,'review_no_punctuation'] =  df_reviews.loc[index,'review_clean'].translate(str.maketrans('', '', string.punctuation))
        
df_reviews.head(10)


# In[88]:


df_reviews_final = df_reviews.drop(['review','review_clean'],axis=1)
df_reviews_final.head(3)


