# ## Level 1 - Kiosk-Kasse
# 
# Unser Lieblings-Kiosk Besitzer Lasse wird komplett überrannt, sodass er gar nicht mehr mit den Bestellungen und er Zubereitung hinterher kommt. Daher wollen wir die Bestellung automatisieren.
# 
# Der Großteil des Codes ist schon vorgegeben.
# 
# **Aufgaben:**
# 
# a) Führe den Code aus und probiere eine Bestellung mit mehreren Dingen aufzugeben. Mache Dich außerdem mit dem Code vertraut.
# 
# b) Ergänze die Speisekarte (Dictionary menu) um ein weiteres Essen und ein weiteres Getränk. Teste danach das Programm und bestelle diese.
# 
# c) Berechne den Gesamtpreis der Bestellung. Dies kannst Du am Ende der Funktion `print_bestellung` machen oder in einer neuen Funktion.
# 
# d) Optional: Erlaube auch klein-geschriebene Eingaben, z.B. "h1". Tipp: `.lower()`
# 
# e) Optional: Hübsche die Ausgaben auf.

# In[ ]:


def print_menu(menu):
  for item in menu:
    print(
        item,
        menu[item]["name"],
        " " * (23 - len(menu[item]["name"])),
        "%.2f" % menu[item]["preis"],
        "€"
    )

def bestellung(menu):
  bestellung_liste = []
  while True:
    user_input = input("Was möchtest du bestellen? (Gib die Nummer an): ")
    ## Aufgabe d) kann hier in der Nähe geloest werden
    if user_input not in menu:
      print("Das habe ich leider nicht verstanden.")
    else:
      bestellung_liste.append(user_input)
      weiter = input("War das alles (Ja/Nein)? ")
      if weiter.lower() == "ja":
        break
  return bestellung_liste

def print_bestellung(bestellung, menu):
  print("\nDanke! Deine Bestellung lautet: ")
  for item in bestellung:
    print(menu[item]["name"], menu[item]["preis"])
  ## Aufgabe c) Gesamtpreis hier ergaenzen


menu={
  "H1": {
      "name": "Linsensuppe",
      "preis": 6.30
  },
  "H2": {
      "name": "Schnitzel mit Pommes",
      "preis": 9.90
  },
  "H3": {
      "name": "Currywurst mit Pommes",
      "preis": 7.70
  },
  "G1": {
      "name": "Cola, Fanta, Sprite",
      "preis": 2.20
  },
  "G2": {
      "name": "Bier",
      "preis": 2.50
  }
  ## Aufgabe b) neues Essen und Getraenk ergaenzen
}

print_menu(menu)
bestellung_liste = bestellung(menu)
print_bestellung(bestellung_liste, menu)


